import React from 'react';

const SplashPage: React.FC = () => {
    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
            <img src="/chem4ap-atom.png" alt="Logo" />
            <h1>Chem4AP</h1>
        </div>
    );
};

export default SplashPage;
